import React from 'react'

const Status = props => {
  if(props.connectionError) {
    return (
      <div className='is-medium'>
        <span>No Data </span>
      </div>
    );
  } else {
    return (
      <div>
        <span className='loader'> &nbsp;</span>
        &nbsp; &nbsp; loading
      </div>
    );
  }
}

export default Status;
